	add("trouser", "{\"term\":\"trouser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|right|A pair of trousers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Of or relating to trousers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"trouser\u0027\u0027 leg\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A pair of trousers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And this is our linen \u0027\u0027trouser\u0027\u0027, sir\", \"priority\":5}]}, \"synonyms\":{}}");

	add("trousers", "{\"term\":\"trousers\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle irish (900-1200)\"], \"text\":\"Attested since the 1610s, from the earlier form \u0027trouzes\u0027 (attested since the 1580s), extended from \u0027trouse\u0027 (1570s), with plural ending typical of things in pairs, from Middle irish (900-1200) \u0027triubhas\u0027 (close-fitting shorts) of uncertain origin. The unexplained intrusive second -r- is perhaps due to the influence of \u0027drawers\u0027.\u0026lt;ref\u0026gt;[http://www.etymonline.com/index.php?term\u003dtrousers Etymology] of trousers in :w:Online Etymology Dictionary|Online Etymology Dictionary\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An article of clothing that covers the part of the body between the waist and the ankles, and is divided into a separate part for each leg\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was April 22, 1831, and a young man was walking down Whitehall in the direction of Parliament Street. He wore shepherd\u0027s plaid \u0027\u0027trousers\u0027\u0027 and the swallow-tail coat of the day, with a figured muslin cravat wound about his wide-spread collar\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“I see you have not changed since you were with me at Malvern House,” he said in an extremely nasty voice, dabbing at the \u0027\u0027trousers\u0027\u0027 with a handkerchief.“Frightfully sorry,” I said. “Too late to be sorry now. A new pair of \u0027\u0027trousers\u0027\u0027 ruined. It is doubtful if anything can remove the stain of tea from white flannel.”\", \"priority\":3}]}, \"synonyms\":{}}");

	add("trousseau", "{\"term\":\"trousseau\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French French|trousseau\u0027, diminutive of \u0027trousse\u0027 ‘bundle’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bundle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The clothes and linen etc. that a bride collects for her wedding and married life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, translating Leo Tolstoy, \u0027Anna Karenina\u0027, Oxford 1998, p. 435\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Consequently, having decided to divide her daughter\u0027s \u0027\u0027trousseau\u0027\u0027 into two parts, a lesser and a larger, the Princess eventually consented to have the wedding before Advent\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, \u0027The Times\u0027, 23 Jul 2011\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"When I moved into his flat, in 1996, I brought two black bin liners of washing-up with me. Dirty washing-up. That was by way of my \u0027\u0027trousseau\", \"priority\":6}]}, \"synonyms\":{}}");

